int countWordOccurrences(const std::string& filename, const std::string& word) {
    std::vector<std::string> lines;
    std::ifstream file(filename);
    std::vector<int> wordCount;

    // Read the content of the file
    while (file.is_open() &&!file.eof()) {
        lines.push_back(line.strip(",.!?")); // Remove newline characters and double spaces
        if (lines.size() > 0) {
            if (lines[0] == word) {
                wordCount.push_back(lines[0].size());
            } else {
                wordCount.push_back(0);
            }
        }
    }

    file.close();
    return wordCount.size();
}

int main() {
    const std::string filename = "your_file.txt";
    const std::string word = "specificWord";  // Replace with the word you want to count

    std::vector<std::string> lines;
    std::ifstream file(filename);

    // Read the content of the file
    while (file.is_open() &&!file.eof()) {
        lines.push_back(line.strip(",.!?")); // Remove newline characters and double spaces
        if (lines.size() > 0) {
            if (lines[0] == word) {
                lines[0].size() += countWordOccurrences(lines[0], word);
                lines[0] = "\n";  // Replace with a newline character
            }
        }
    }

    file.close();

    if (lines.size() > 0) {
        std::cout << "The word " << word << " occurs " << lines[0].size() << " times in the file." << std::endl;
    } else {
        std::cout << "The word " << word << " does not occur in the file." << std::endl;
    }

    return 0;
}
