### Explanation:
1. **Function `countWordOccurrences`**:
    - Takes a filename and a word as input.
    - Opens the file, reads it line by line, and counts the occurrences of the specified word.
    - Returns the count of occurrences.

2. **`main` Function**:
    - Specifies the filename and the word to search for.
    - Reads the file line by line, applies the word count function, and updates the lines array.
